import React from 'react';
import type { FunctionComponent } from 'react';
import Logojpeg from '/home/user/website/src/Assets/Images/doorbellLogo.png'

interface LogoProps {
    primaryColor?: string;
    secondaryColor?: string;
    width?: number;
    height?: number;
}

const Logo: FunctionComponent<LogoProps> = ({
    primaryColor = '#0d76c6',
    secondaryColor = 'white',
    width = 1280,
    height = 1280
}) => {
    return (
        <div>
        <img src={Logojpeg} alt="My Image" />
      </div>
    );
};

export default Logo;
